import React from "react";

class Navbar extends React.Component{
    render(){
        return(
            <nav>
                <div className="main-wrapper">
                    
                    <h2><b>NewsBix</b></h2>
                    <button className="btn" style={{backgroundColor:"blue"}}>
                        Login
                    </button>
                    

                    
                </div>
            </nav>
        );
    }
}

export default Navbar;
